import React from 'react'
import { useFeed } from './util/hooks'

const Feed = () => {
  const { feed } = useFeed()

  return feed ? (
    <>
      <ul>
        {feed.map((item, i) => {
          <li key={i}> {item} </li>
        })}
      </ul>
    </>
  ) : null
}

export default Feed
